:space rdfs:subClassOf [ a owl:Restriction ;
            owl:hasValue :meter ;
            owl:onProperty :has_default_unit ],
        :dimension .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:equator rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :pole ;
            owl:onProperty :perpendicular_to ],
        :bearing,
        :direction,
        :inclination .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:horizontal_coordinate rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :vertical_coordinate ;
            owl:onProperty :orthogonal_to ],
        :component,
        :coordinate .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vertical rdfs:subClassOf [ a owl:Restriction ;
            owl:hasValue :up ;
            owl:onProperty :has_direction ],
        :component,
        :coordinate ;
    owl:equivalentClass :vertical_coordinate .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:geometrical_object_0d rdfs:subClassOf [ a owl:Restriction ;
            owl:hasValue 0 ;
            owl:onProperty :has_dimension ],
        :geometrical_object ;
    owl:equivalentClass :point .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:polygon rdfs:subClassOf [ a owl:Restriction ;
            owl:allValuesFrom :point ;
            owl:onProperty :has_vertices ],
        :geometrical_object_2d .
